window.bookSummaryJSON = "<p><b>When Van Tudor returns to his childhood home, he inherits more than the family farm.</b></p> <p>His grandfather used to tell him fantastic stories of spacemen and monsters, princesses and galactic knights. Little did Van realize, the old man's tales were more than fiction; they were real.</p> <p>Hidden beneath the old barn, Vanâ€™s legacy is waiting: a starship, not of this world. With his combat AI, an android bird named Perry, Van takes his first steps into the wider galaxy. He soon finds that space is far busier and more dangerous than he could have ever conceived.</p> <p>Destiny is calling. His grandfather's legacy awaits.</p> <p>Embark on the adventure of a lifetime with <i>USA Today</i> best-selling author J.N. Chaney and Terry Maggert in this galactic quest for glory.</p>"; 
